  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:52.720587\",\n\t\"name\": \"wheeler-national-wildlife-refuge-annual-narrative-report-calendar-year-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Wheeler,
  Watercress Darter, Fern Cave, and Blowing Wind Cave (now Sauta Cave) National Wildlife
  Refuges covers refuge activities during the 1984 calendar year.  The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. Refuge administration is outlined; information about personnel, youth
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grazing, haying,
  fire management, pest control, and wilderness areas. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  scientific collections, animal control, marking and banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about major maintenance, equipment replacement, and energy
  conservation. Cooperative programs and items of interest are provided at the end\",\n\t\"license_title\":
